import React, { useState } from 'react';
import { useFormik } from 'formik';
import * as Yup from 'yup';

function ProfilePage() {
    const [profileImage, setProfileImage] = useState('https://via.placeholder.com/150');
    const [signatureImage, setSignatureImage] = useState('https://via.placeholder.com/150');

    const formik = useFormik({
        initialValues: {
            fullName: 'John Doe',
            email: 'john.doe@example.com',
            bio: '',
            availableTime: '',
            registeredId: '',
            digitalSignature: '',
            currentHospitals: '',
            age: '',
            contactNo: ''
        },
        validationSchema: Yup.object({
            fullName: Yup.string().required('Full name is required'),
            email: Yup.string().email('Invalid email address').required('Email is required'),
            bio: Yup.string(),
            availableTime: Yup.string(),
            registeredId: Yup.string().required('Registered ID is required'),
            currentHospitals: Yup.string().required('Current working hospitals are required'),
            age: Yup.number().required('Age is required').positive().integer(),
            contactNo: Yup.string().matches(/^[0-9]+$/, "Must be only digits").min(10, 'Must be exactly 10 digits').max(10, 'Must be exactly 10 digits')
        }),
        onSubmit: values => {
            console.log('User Profile:', values);
            alert('Profile updated!');
        },
    });

    const handleImageChange = (event, imageSetter) => {
        const file = event.target.files[0];
        if (file) {
            imageSetter(URL.createObjectURL(file));
        }
    };

    return (
        <div className="profile-container">
            <h1>Edit Profile</h1>
            <form onSubmit={formik.handleSubmit} className="profile-form">
                {/* Other form groups */}
                <div className="form-group">
                    <label htmlFor="registeredId">Registered ID:</label>
                    <input
                        id="registeredId"
                        type="text"
                        {...formik.getFieldProps('registeredId')}
                    />
                    {formik.touched.registeredId && formik.errors.registeredId ? (
                        <div className="error">{formik.errors.registeredId}</div>
                    ) : null}
                </div>
                <div className="form-group">
                    <label htmlFor="digitalSignature">Digital Signature:</label>
                    <input
                        id="digitalSignature"
                        type="file"
                        accept="image/*"
                        onChange={(event) => handleImageChange(event, setSignatureImage)}
                    />
                    <img src={signatureImage} alt="Signature" className="profile-image" />
                </div>
                <div className="form-group">
                    <label htmlFor="currentHospitals">Current Working Hospitals:</label>
                    <input
                        id="currentHospitals"
                        type="text"
                        {...formik.getFieldProps('currentHospitals')}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="age">Age:</label>
                    <input
                        id="age"
                        type="number"
                        {...formik.getFieldProps('age')}
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="contactNo">Contact No:</label>
                    <input
                        id="contactNo"
                        type="text"
                        {...formik.getFieldProps('contactNo')}
                    />
                    {formik.touched.contactNo && formik.errors.contactNo ? (
                        <div className="error">{formik.errors.contactNo}</div>
                    ) : null}
                </div>
                {/* Submit button */}
                <button type="submit" className="update-button">Update Profile</button>
            </form>
        </div>
    );
}

export default ProfilePage;
